import React from 'react';
import '../css/home.css';

function About() {
    return (
        <div className="about-gridbox">
            <div className="about-grid-item">
                <div className="about-text">
                    <h3>A Memorable Experience for the Whole Family!</h3>
                    <p>Join us at Amusement Park for the time of your life! We have many amazing rides and activities for all ages, so kids and adults alike will never get bored!</p>
                </div>
            </div>
        </div>
    );
}

export default About;
